   "source": [
    "activity %>%\n",
    "select(TotalSteps,\n",
    "      SedentaryMinutes,\n",
    "      Calories) %>% summary()\n",
    "# explore num of active minutes per category\n",
    "activity %>%\n",
    "  select(VeryActiveMinutes, FairlyActiveMinutes, LightlyActiveMinutes) %>%\n",
    "  summary()\n",
    "\n",
    "# calories\n",
    "calories %>%\n",
    "  select(Calories) %>%\n",
    "  summary()\n",
    "# sleep\n",
    "sleep %>%\n",
    "  select(TotalSleepRecords, TotalMinutesAsleep, TotalTimeInBed) %>%\n",
    "  summary()\n"
   ]
  },
