   "source": [
    "Whats can we infer from the above?!\n",
    "* The average steps taken is 7500, which is ideal in several studies, but the 10k mark is also widespread minimum\n",
    "* The average Calories is 2300, which is 15% more than the required daily average as per WHO\n",
    "* The subjects are sedentary, clocking more than 15.5 hours, which needs to be cautioned\n",
    "* The Participants sleep for little more than 6 hours on average, which is relatively optimal"
   ]
