   "source": [
    "# ggplot(data=dailyActivity, aes(x=\"TotalSteps\",y=\"Calories\"))+ geom_point()+  geom_smooth(method=lm, formula = y ~ x)\n",
    "#plotting a scatterplot of calories burned for every step taken\n",
    "\n",
    "ggplot(activity, aes(x=TotalSteps, y=Calories)) + \n",
    "  geom_point(fill=\"blue\",color=\" violet\",alpha=01,size=2.5)+\n",
    "  ggtitle(\"Calories burned for every step taken\")+\n",
    "  geom_hline(yintercept = mean(activity$Calories, na.rm=TRUE),color=\"orange\",size=1)+\n",
    "  geom_vline(xintercept = mean(activity$TotalSteps, na.rm=TRUE),color=\"orange\")+\n",
    "annotate('text', y=0,x=10000,label=\"mean:number of steps taken\", fontface='bold')+\n",
    "annotate('text', y=2200,x=32000,label=\"mean:calories\", fontface='bold')+\n",
    "  geom_smooth(color='purple')"
   ]
  },
