    "ggplot(data=merged_data, aes(x=TotalMinutesAsleep, y=SedentaryMinutes)) + \n",
    "geom_point(color='violet') + geom_smooth(color=\"purple\") +\n",
    "geom_hline(yintercept=mean(merged_data$SedentaryMinutes, na.rm=TRUE),color=\" orange\",size=0.5)+\n",
    "geom_vline(xintercept=mean(merged_data$TotalMinutesAsleep, na.rm=TRUE),color=\"orange\",size=0.5)+\n",
    "annotate('text', y=5,x=450,label=\"mean:Total minutes asleep\", fontface='bold',color='purple')+\n",
    "annotate('text', x=05,y=620,label=\"mean:Sedentary activity in minutes\", fontface='bold' ,angle=89,color='purple')+labs(title=\"Minutes Asleep vs. Sedentary Minutes\")\n"
   ]
