    "## Top high-level insights / suggestions based on the analysis\n",
    "1. The participants are found out to be sedentary i.e. at rest most of the time🦥which could lead to many diseases like heart failures and many more. We, could alert our customers to active from time to time, to take a walk🚶,stretch,take a fresh air, etc. By doing that people can also have a better sleep.\n",
    "2. Most of the participants clock near 7500 steps a day, we can encourage the customers to make the effort to log the 10k-a-day goal,which might make them feel accomplished in the health front🏅\n",
    "3. Participant are going over board with calories with averges 15% higher than the recommended level by W.H.O. We can help them by facilitating them to log their calories intake and can plan diets properly🥗\n",
    "4. The average sleep of participants is just above 6 hours a day. Though sleep required is quite relative to the person, we can just remind to have good night sleep and to switch digital instuments off so that they can sleep the moment they lay down🛌🏻\n",
    "5. The participants experience high intensity from 8am-8pm, which we can assume beacuse of work. we can remind them to take a drinking break or 10 minutes nap, so that they dont get stressed out have higher productivity thorough out the day😀\n"
   ]
